import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import {Observable} from 'rxjs';
@Injectable({
  providedIn: 'root'
})
export class SharedService {
readonly APIUrl = "http://localhost:52984/api";

  constructor(private http: HttpClient) { }

  RegisterUser(firstname:any, lastname:any, email:any, password:any){
    return this.http.post(this.APIUrl+'/pages/authentication/register', firstname && lastname && email && password);
  }

